data.value:
Байт-код (P-код) – оптимизированный набор инструкций, предназначенных для исполнения виртуальной машиной Java (JVM). Байт-код решает проблемы обеспечения безопасности и переносимости Java-программ, так как не является исполняемым кодом.

Лексика и синтаксис языка

Ключевые слова Java:
abstract, continue, for, new, switch, assert, default, goto, package, synchronized
boolean, do, if, private, this, break, double, implements, protected, throw, byte, else, import, public, throws, case, enum, instanceof, return, transient, catch, extends, int, short, try, char, final, interface, static, void, class, finally, long, strictfp, volatile, const, float, native, super, while, true, false и null.

Идентификаторы
    • любая последовательность строчных и прописных букв, цифр или символов
подчеркивания и символов доллара;
   • не должны начинаться с цифры, count (корректно), 2count (не корректно);
   • чувствительность к регистру символов, Value≠VALUE.

Константы
    • целочисленная – 100;
    • вещественная – 98,6;
    • символьная – ‘Y’;
    • строковая – “This is a text”.

Комментарии
    • // – однострочные;
    • /* … */ – многострочные;
    • /** … */ – документации.

Разделители
    • () – для передачи списков параметров в определениях и вызовах методов, определения приоритетов в выражениях, указания выражений в управляющих операторах и указания преобразования типов;
    • {} – для определения блоков кода, классов, методов и локальных областей определения, а также для указания значений автоматически инициализируемых массивов;
    • [] – для объявления типов массивов, при разыменовании значений массивов;
    • ; – завершение оператора;
    • , – для разделения последовательных идентификаторов в объявлениях переменных, создания цепочек операторов внутри оператора for;
    • . – для разделения имен пакетов от подпакетов и классов, а также для отделения переменной или метода от ссылочной переменной.

Все целые типы в Java знаковые, соответствующих беззнаковых эквивалентов, как в C++, в Java нет.

boolean
    • размер в спецификации языка не указан;
    • может иметь значения true и false;
    • значение по умолчанию false;
    • для представления переменной или поля используется тип int;
    • для представления массива используется массив byte.

void
    • фактически типом не является;
    • используется при описании метода для указания того, что данный метод ничего не возвращает.

Класс – ключевое понятие в Java.
Класс – способ описания типа.
Класс определяет структуру и поведение (данные и код), которые будут
совместно использоваться набором объектов (экземпляров класса).

Описание класса
class MyClass {
 … // тело класса
}
• class – ключевое слово;
• MyClass – имя класса;
• внутри фигурных скобок находится тело класса;
• внутри тела класса в произвольном порядке описываются поля и методы
класса.

Переменные

Переменная – основной компонент хранения данных.
Переменная определяется комбинацией идентификатора, типа и необязательного начального значения.
тип идентификатор [= значение][,идентификатор[= значение] …];
тип – один из базовых типов либо имя класса или интерфейса.
идентификатор – имя переменной.

Объект (экземпляр класса, class instance)

Объект – переменная класса.
Каждый объект определенного класса содержит структуру и поведение, которые определены классом.

Ссылки на объекты

В Java для манипулирования объектами используются ссылки на объекты (handles).
• ссылка хранит в себе некоторый адрес объекта в оперативной памяти;
• на один объект может быть несколько ссылок;
• на объект может не быть ссылок (он безвозвратно потерян);
• ссылка может не ссылаться ни на какой объект (пустая ссылка, null);
• не может быть ссылки в никуда;
• не может быть ссылки на произвольную область памяти;
• все ссылки имеют имя;
• все ссылки строго типизированы.

Пример описания ссылки

MyType ref;
MyType – имя типа, ref – имя ссылки.
После описания ссылке ref можно присвоить значение – адрес объекта типа MyType.

Создание объектов

Все объекты в Java создаются только явно, для чего используется операция new.
ref = new MyType();
Создается объект типа MyType и его адрес заносится в ref.
Описание ссылки можно совместить с инициализацией.
MyType ref = new MyType();

Ссылка хранит адрес объекта, а объект уже хранит содержательную информацию. В отличие от ссылок, данные базовых типов являются самосодержащими, они сами хранят содержательную информацию.

Ссылка на объект                                                                                                                                                                                       Данное базового типа










Описание полей класса

Поля класса (fields or instance variable)
• определяют, из каких данных будут состоять объекты этого класса.
• могут быть ссылками на другие объекты или элементарными данными (данными базовых типов).
• описываются непосредственно в теле класса, на том же уровне вложенности, что и методы класса.
class SomeClass {
 int i = 0;
 MyType ref;
 …
// методы класса
 …
}

Описание методов класса

<тип> <имя_метода> ([<аргументы>]) {
 <тело_метода>
}
<тип> – один из базовых типов или имя класса
<аргументы> – список (возможно пустой) параметров
<тело_метода> – собственно программный код
Каждый аргумент метода – пара “<тип> <имя_аргумента>”
Аргументы отделяются друг от друга запятыми. Описание методов (class methods) расположены внутри класса, на том же уровне вложенности, что и описание полей класса. Не может быть описания метода вне класса или внутри другого метода или блока.
Методы, тип возвращаемого значения которых отличается от void, возвращают значение вызывающей процедуре (в место вызова) с помощью следующей формы оператора return:
return <значение>

Вызов методов

При вызове метода класса обязательно должен быть указан объект этого класса и метод вызывается для этого объекта.
a.f(x);
b.g();
v = b.f(3);
a и b – ссылки с типом SomeClass, x и v – целочисленные переменные
При вызове метода класса из метода того же класса объект указывать необязательно.
Вызов метода часто называют отправкой сообщения объекту.
Например, вызов f() – сообщение, a – объект.

Доступ к полям класса

При обращении к полю класса извне класса объект должен быть указан явно (при помощи ссылки на объект) перед именем поля через точку.
obj.i = 100;
x = obj.ref;
obj – ссылка с типом SomeClass, i и ref – поля класса
Изнутри класса (из методов класса) можно обращаться к полям класса напрямую.

Конструктор класса

MyType ref = new MyType();
В данном примере имя класса, за которым следуют круглые скобки, указывает конструктор данного класса. Конструктор инициализирует объект непосредственно во время создания. Его имя совпадает с именем класса, в котором он находится, а синтаксис аналогичен синтаксису метода. Как только он определен, конструктор автоматически вызывается непосредственно после создания объекта, перед завершением выполнения операции new. Однако если никакой явный конструктор не указан, Java автоматически предоставит конструктор, используемый по умолчанию.
Описание конструктора класса
<имя_конструктора> ([<аргументы>]) {
 <тело_конструктора>
}

Автоматические упаковка (boxing) и распаковка (unboxing) типов

Автоупаковка является механизмом для скрытого преобразования примитивных типов данных в соответствующие классы-оболочки(объекты). Автоупаковка преобразует логический тип boolean в Boolean, byte в Byte, char в Character, float в Float, int в Integer, long в Long, short в Short.
// Boxing
int n = 123;
Integer integer = n;
// Unboxing
int in = 0;
in = new Integer(123);
Применяются при передаче в качестве параметра метода и присваивании значений переменным.

Область видимости и время жизни переменных

В Java только один тип переменных – локальные переменные. Время жизни переменной в Java определяется правилом – переменная создается в точке ее описания и существует до момента окончания того блока, в котором находится данное описание. В Java блок – это то, что начинается открывающей фигурной скобкой ‘{’ и заканчивается закрывающей фигурной скобкой ‘}’. Областью видимости переменной является фрагмент программы от точки ее описания до конца текущего блока. Если в блоке, где описана данная переменная, вложены другие блоки, то переменная доступна в этих блоках. Но, в отличие от многих других языков, в Java запрещено переопределять переменную во вложенных блоках.
Область видимости объекта определяется областью видимости ссылок на этот объект, так как объекты доступны в программе только через ссылки на них. Время жизни объекта в Java определяется правилом – объект существует, пока существует хотя бы одна ссылка на этот объект. Как только прекращает существование последняя ссылка на объект, он становится недоступным и может быть уничтожен. В Java нет явного уничтожения объектов. Объекты уничтожаются (утилизируются) сборщиком мусора (garbage collector), который работает в фоновом режиме параллельно с самой программой на Java.

